namespace WCFApplication
{
    // NOTE: You can use the "Rename" command on the "Refactor" menu to change the class name "Service1" in code, svc and config file together.
    // NOTE: In order to launch WCF Test Client for testing this service, please select Service1.svc or Service1.svc.cs at the Solution Explorer and start debugging.
    public class AppointmentAggregate
    {
        public string Id { get; set; }
        public string AppointmentSubject { get; set; }
        public string ResourceName { get; set; }
        public string StartHour { get; set; }
        public string EndHour { get; set; }
        public string AppointmentSecretary { get; set; }
        public string AbsentGuests { get; set; }
        public string PresentGuests { get; set; }
        public string AppointmentAgendas { get; set; }
        public string AppointmentTalks { get; set; }
        public string DocumentCode { get; set; }
        public string EditNumber { get; set; }
        public string EditDatePersian { get; set; }
        public string SecretaryOfStateNumber { get; set; }
        public string AppointmentLicenseCode { get; set; }
        public string AppointmentLicenseTitle { get; set; }
        public string AppointmentId { get; set; }
        public string TrusteeDomainTitle { get; set; }
        public string AppointmentTitle { get; set; }
    }
    public class ServiceGenerator : IServiceGenerator
    {
        public static string key => "";
        public static string logoImage => "";
        public string logoImageSazmanParkHa => "data:image/png;base64,";

        public string Generator(int appointmentId, string filePath, string fileName)
        {
            // ------------------------- FAKE AGGREGATE DATA -------------------------
            AppointmentAggregate agg = new AppointmentAggregate()
            {
                Id = appointmentId.ToString(),
                AppointmentId = $"A-{appointmentId:0000}",
                AppointmentTitle = "Monthly Strategic Board Meeting",
                AppointmentTalks = "Discussion about budget allocation and upcoming events.",
                AppointmentSecretary = "Sarah Johnson",
                AppointmentSubject = "Organization Development",
                StartHour = "09:00",
                EndHour = "11:30",
                ResourceName = "Conference Room 3A",

                AppointmentLicenseCode = "LIC-889912",
                AppointmentLicenseTitle = "Executive License",
                TrusteeDomainTitle = "Public Affairs Committee",
                SecretaryOfStateNumber = "ST-5567",

                PresentGuests = "John Doe, Emma Brown, Ali Karimi",
                AbsentGuests = "Michael Green (Sick)",

                AppointmentAgendas = "1- Budget review\n2- HR Planning\n3- Technology roadmap",

                DocumentCode = "DOC-2025-001",
                EditDatePersian = "1403/11/15",
                EditNumber = "4"
            };


            // ---------------------------- DATASET ----------------------------
            DataSet reportData = new DataSet("AppointmentDataSet");
            DataTable table = new DataTable("Appointment");

            table.Columns.Add("Id", typeof(int));
            table.Columns.Add("AppointmentSubject", typeof(string));
            table.Columns.Add("ResourceName", typeof(string));
            table.Columns.Add("StartHour", typeof(string));
            table.Columns.Add("EndHour", typeof(string));
            table.Columns.Add("AppointmentSecretary", typeof(string));
            table.Columns.Add("AbsentGuests", typeof(string));
            table.Columns.Add("PresentGuests", typeof(string));
            table.Columns.Add("AppointmentAgendas", typeof(string));
            table.Columns.Add("AppointmentTalks", typeof(string));
            table.Columns.Add("DocumentCode", typeof(string));
            table.Columns.Add("EditNumber", typeof(string));
            table.Columns.Add("EditDatePersian", typeof(string));
            table.Columns.Add("SecretaryOfStateNumber", typeof(string));
            table.Columns.Add("AppointmentLicenseCode", typeof(string));
            table.Columns.Add("AppointmentLicenseTitle", typeof(string));
            table.Columns.Add("AppointmentId", typeof(string));
            table.Columns.Add("TrusteeDomainTitle", typeof(string));
            table.Columns.Add("AppointmentTitle", typeof(string));

            table.Rows.Add(
                appointmentId,
                agg.AppointmentSubject,
                agg.ResourceName,
                agg.StartHour,
                agg.EndHour,
                agg.AppointmentSecretary,
                agg.AbsentGuests,
                agg.PresentGuests,
                agg.AppointmentAgendas,
                agg.AppointmentTalks,
                agg.DocumentCode,
                agg.EditNumber,
                agg.EditDatePersian,
                agg.SecretaryOfStateNumber,
                agg.AppointmentLicenseCode,
                agg.AppointmentLicenseTitle,
                agg.AppointmentId,
                agg.TrusteeDomainTitle,
                agg.AppointmentTitle
            );

            reportData.Tables.Add(table);


            // -------------------- REPORT VARIABLES --------------------
            Dictionary<string, object> variables = new Dictionary<string, object>()
    {
        { "Id", agg.Id },
        { "AppointmentSubject", agg.AppointmentSubject },
        { "ResourceName", agg.ResourceName },
        { "StartHour", agg.StartHour },
        { "EndHour", agg.EndHour },
        { "AppointmentSecretary", agg.AppointmentSecretary },
        { "AbsentGuests", agg.AbsentGuests },
        { "PresentGuests", agg.PresentGuests },
        { "AppointmentAgendas", agg.AppointmentAgendas },
        { "AppointmentTalks", agg.AppointmentTalks },
        { "DocumentCode", agg.DocumentCode },
        { "EditNumber", agg.EditNumber },
        { "EditDatePersian", agg.EditDatePersian },
        { "SecretaryOfStateNumber", agg.SecretaryOfStateNumber },
        { "AppointmentLicenseCode", agg.AppointmentLicenseCode },
        { "AppointmentLicenseTitle", agg.AppointmentLicenseTitle },
        { "AppointmentId", agg.AppointmentId },
        { "TrusteeDomainTitle", agg.TrusteeDomainTitle },
        { "AppointmentTitle", agg.AppointmentTitle }
    };


            // ------------------------ LOAD REPORT ------------------------
            Stimulsoft.Base.StiLicense.Key = key;

            var report = new StiReport();
        
            // Correct MRT loading (remove quotes around path)
            string mrtPath = @"F:\Projects\GitHub\Tajerbashi\SourceApps\StimulsoftGenerator\WCFWebApi\wwwroot\templates\appointments.mrt";
            var mrtBytes = File.ReadAllBytes(mrtPath);
            report.Load(mrtBytes);

            // Register DataSet
            report.RegData(reportData);

            // Set Variables
            foreach (var v in variables)
                report[v.Key] = v.Value;


            // ------------------------ INSERT LOGO ------------------------
            string logo = logoImage; // Base64
            StiImage imageLogo = report.GetComponentByName("ImageLogoComponent") as StiImage;

            if (imageLogo != null && !string.IsNullOrEmpty(logo))
            {
                imageLogo.Image = Stimulsoft.Base.Drawing.StiImageConverter.StringToImage(logo);
            }


            // ------------------------ BARCODE ------------------------
            StiBarCode barcode = report.GetComponentByName("BarCodeSign") as StiBarCode;
            if (barcode != null)
                barcode.CodeValue = $"https://example.com/appointment/{appointmentId}";


            // ------------------------ EXPORT PDF ------------------------
            report.Render(false);

            string pdfOutput = Path.Combine(filePath, $"{fileName}.pdf");

            using (FileStream fs = new FileStream(pdfOutput, FileMode.Create))
            {
                report.ExportDocument(StiExportFormat.Pdf, fs, new StiPdfExportSettings()
                {
                    EmbeddedFonts = true
                });
            }

            return pdfOutput;
        }


        public string GetData(int value)
        {
            return string.Format("You entered: {0}", value);
        }

        public CompositeType GetDataUsingDataContract(CompositeType composite)
        {
            if (composite == null)
            {
                throw new ArgumentNullException("composite");
            }
            if (composite.BoolValue)
            {
                composite.StringValue += "Suffix";
            }
            return composite;
        }
    }
}
